import React, { Fragment } from "react";
import TrackItem from "./TrackItem";

const TopTracks = (props) => {
  console.log(props.topTracks);

  return (
    <Fragment>
      <h1>The Top Tracks Page</h1>
      <ul>
        <TrackItem
          key={props.topTracks.items[0].external_ids.isrc}
          title={props.topTracks.items[0].name}
          artists={props.topTracks.items[0].artists}
        />
      </ul>
    </Fragment>
  );
};

export default TopTracks;
